VEGAN PASS THE COOKBOOK 📚 CHALLENGE (+ GIVEAWAY!)

The #FriendlyVeganCookbook is all about food sharing, so we gathered our fabulous friends to cook up some delicious #vegan grub together—virtually! See the pages of our new book 📖 come to life in the friendly kitchens of...

@plantbasedonabudget (Toni)
@vegan (Michelle)
@veggiekins (Remy)
@twospoons.ca (Hannah)
@alexbluedavis (Alex)
@theplantriot (Rachel)
@veganwhat (Stephanie)
@plantyou (Carleigh)
@megunprocessed (Megan)
@sweetsimplevegan (Jasmine)
@consciouschris (Chris)
@alexafuelednaturally (Alexa)

If you're hungry for friendly food-spiration 🍅🍑🌽🥬🍆🥥 be sure to give these inspiring friends 👆 a follow!

GIVEAWAY DETAILS:

We want to help YOU cook with YOUR friends too! So we're giving away a copy of the #FriendlyVeganCookbook to you and a friend. 🥳🥳 To enter, simply tag a friend you'd love to cook virtually with in the comments below 👇 and they'll win a copy too! Multiple entries allowed in separate comments—open internationally! We'll send you a DM if you win :)

🎁 Gift a copy to yourself or a friend at: FriendlyVeganCookbook.com

Big hugs, and happy cooking!
♥️Toni + Michelle
